INTERNATIONAL JOURNAL OF ENGINEERING SCIENCES AND RESEARCH TECHNOLOGY   (IJESRT, ISSN 2277-9655) 

Invites you to submit your research paper for publishing in 

VOLUME 8 ISSUE 8 (August-2019)

Click to Submit Manuscript Online  http://ijesrt.com/submit_manuscript_online.php

http://ijesrt.com/submit_manuscript_online.php http://ijesrt.com/submit_manuscript_online.php

About IJESRT  (P.Impact Factor: 5.164)    

To maintain a high-quality journal, manuscripts that appear in the IJESRT have been subjected to a rigorous review process. This includes blind reviews by three or more members of the editorial review board, followed by a detailed review by the IJESRT editors.

Subject Category: 

Cover all branches of Engineering and Science

Important Dates:

Paper Submission:  11 August 2019
	Published Online on: 15 August 2019.

Review Results (Acceptance/Rejection) Notification: Within 02  Days after submitting the paper.

